uint16_t get_rand(){
  short ret;
  if(first ==1){
    if(set_seed == 0){
      int fd;
      fd = open("/dev/urandom",0);
      read(fd,&seed,4);
      close(fd);
      FILE *fp = fopen(log_file,"a");
      fprintf(fp,"seed: %ld, rate: %ld, bitlen: %ld max_loop: %ld\n", seed, rate,
              bitlen, max_loop);
      fclose(fp);
      sync();
    }
    srand(seed);
    first = 0;
  }
  ret = (uint16_t)rand() & 0xffff;
  return ret;
}
uint32_t get_rand32(){
  uint32_t ret = (get_rand() << 16) | get_rand();
  return ret;
}
